import React from 'react';
import User from './User';


const UserList = ({userList})=>{
    return (
        <div>
            <h2>User List</h2>
            {userList.map((user, index)=>(
                <User
                    key={index}
                    name={user.Name}
                    email={user.Email}
                    grade={user.FinalProjectGrade}
                    reaction={user.Impression}
                />
                ))}
        </div>
    )
}

export default UserList;
